Bio: I am a student. When I finish studying, I'll be a translator. My greatest hobby? Perhaps it is sports and shopping. I go to fitness centers, gyms, the swimming pool and a jogging track. Every morning we run around with friends for about 20 minutes. Shopping is my second hobby. I love to go to expensive shops and I love when staff supports me and tries to sell something. Sometimes I lose my head, and buy a bunch of unnecessary things, which I then distribute to my girlfriends! 

